          _webViewController = controller;            
        },
        onConsoleMessage: (controller, consoleMessage) {
          log(consoleMessage.toString());
        },
        
        onLoadError: (controller,url,a,b){
        log('OnLoad Error called');
        },
        onProgressChanged: (controller, progress) {
                    log('$progress'.toString());
                    },
        onLoadStop: (controller, url) async {
          
          log('OnLoad Stop called');
            _webViewController.evaluateJavascript(
              source: 'alert (\'JsRunning\');');

          try {
            String js = """
              (function() {
                var rows = document.querySelectorAll('body > div.my-table.mumraj-sl > table  tr');
                 rows.forEach(function(row, index) {
                  // Ensure the row has at least two columns
                   if(index==0){
                     row.cells[1].innerHTML = 'Result';
                   }else if(index==1){
                    row.cells[1].innerHTML ='${map![StringConst.moring_9_30_am]}' ;
                     row.cells[3].innerHTML ='${map![StringConst.afernoon_03_30_pm]}' ;
                   }else if(index==2){
                    row.cells[1].innerHTML ='${map![StringConst.moring_10_30_am]}' ;
                     row.cells[3].innerHTML ='${map![StringConst.afernoon_04_30_pm]}' ;
                   }else if(index==3){
                    row.cells[1].innerHTML ='${map![StringConst.moring_11_30_am]}' ;
                     row.cells[3].innerHTML ='${map![StringConst.evening_05_30_pm]}' ;
                   }else if(index==4){
                    row.cells[1].innerHTML ='${map![StringConst.afernoon_12_30_pm]}' ;
                     row.cells[3].innerHTML ='${map![StringConst.evening_06_30_pm]}' ;
                   }else if(index==5){
                    row.cells[1].innerHTML ='${map![StringConst.afernoon_01_30_pm]}' ;
                     row.cells[3].innerHTML ='${map![StringConst.evening_07_30_pm]}' ;
                   }else if(index==6){
                    row.cells[1].innerHTML ='${map![StringConst.afernoon_02_30_pm]}' ;
                     row.cells[3].innerHTML ='${map![StringConst.evening_08_30_pm]}' ;
                   }
    
                });

            
                return 'HTML manipulation completed';
              })();
            """;

            String result =
                await _webViewController.evaluateJavascript(source: js);
            log("JavaScript result: $result"); 
          } catch (e) {
            log("Error executing JavaScript: $e");
          }
        });
  }

  getHTML() async {
    try {
      final url = Uri.parse('https://test.smarpees.com/api/order/dp-boss-data');
      log('api call started');
      final respone = await http.get(
        url,
      );
