       var parentDiv =document
          .querySelectorAll('body > div.text2')
          .last;
        
          if (parentDiv != null) {
    // Get all child nodes of the parent div
    var childNodes = parentDiv.nodes;

    // Loop through each child node
      for(int a=0; a<childNodes.length;a++){
        if(a==2){
          childNodes[a].text = 'अपना बाजार dpboss5g वेबसाइट में डलवाने';
        }else if(a==7){
          childNodes[a].text = 'Email : dpBoss5g@gmail.com';
        }
          
      }
   
  }
        
       // if(noticePride!=null)  {
