        notice.children.add(dom.Element.html(noticeSection()));
        } */

      document
          .querySelector('body > div.my-table.mumraj-sl > table > tbody')
          ?.remove();
      final tbody = document.querySelector('body > div.my-table.mumraj-sl > table ');
      if (tbody != null) {
        tbody.children.add(dom.Element.html(maniputedHTML()));
        }
      


      document.querySelector('body >div.oc-fg>.pow-13')?.remove();
       final bottomTitle  = document.querySelector('body > div.oc-fg');
       if(bottomTitle!=null){
        bottomTitle.children.add(dom.Element.html('<h6 class="pow-13">POWERD BY DpBoss5G</h6>'));  
       }
       

      document.querySelectorAll('body >div.oc-fg >div.lst-sec').last.remove();
      final bottomDetail = document.querySelectorAll('body >div.oc-fg ').last;
      bottomDetail.children.add(dom.Element.html(manipulateBottom()));  
    
     
       
      srcHtml = document.outerHtml;
    
      _webViewController.loadData(
          data: srcHtml, mimeType: "text/html", encoding: "utf-8");

     
    } catch (e) {
      log(e.toString());
    }
  

  }
  
